import React from 'react'
import './expand.css'

export default function Expand({ content, isShow }) {
  return (
    <div className="expand_outbox">
      {isShow &&
        <div className="expand_test">
          {content["grades"].map((grade, index) =>
            <div >
              Test {index}:  {grade.concat("%")}
            </div>
          )}
        </div>
      }
    </div>
  )
}
